import React from 'react';
import { withRouter } from 'react-router-dom';
//import logo from './logo.svg';
import { Row } from 'reactstrap';
import { getUserInfoField } from '../Utility/Utility';
import styles from './Welcome.module.css';
//import { getUserInfo } from './Utility';

import {Carousel,CarouselItem,CarouselControl,CarouselIndicators} from 'reactstrap';

class Welcome extends React.Component{
    constructor(props){
       super(props);
        this.state = { activeIndex: 0 };
        this.next = this.next.bind(this);
        this.previous = this.previous.bind(this);
        this.goToIndex = this.goToIndex.bind(this);
        this.onExiting = this.onExiting.bind(this);
        this.onExited = this.onExited.bind(this);

     }
    redirectHandler = (url) => {
        this.props.history.push(url);
    }
    chooseHandler() {
        if(this.state.activeIndex === 0){
            this.props.history.push("/signup");
        }
        else if (this.state.activeIndex === 1){
            this.props.history.push("/login");
        }else
            this.props.history.push("/search");
    }
    onExiting() {
        this.animating = true;
    }

    onExited() {
        this.animating = false;
    }

    next() {
        if (this.animating) return;
        const nextIndex = this.state.activeIndex === items.length - 1 ? 0 : this.state.activeIndex + 1;
        this.setState({ activeIndex: nextIndex });
    }

    previous() {
        if (this.animating) return;
        const nextIndex = this.state.activeIndex === 0 ? items.length - 1 : this.state.activeIndex - 1;
        this.setState({ activeIndex: nextIndex });
    }

    goToIndex(newIndex) {
        if (this.animating) return;
        this.setState({ activeIndex: newIndex });
    }
    render(){
        const { activeIndex } = this.state;

        const slides = items.map((item) => {
            return (
                <CarouselItem
                    onExiting={this.onExiting}
                    onExited={this.onExited}
                    key={item.src}
                >
                    <img src={(item.src)} alt={item.altText} onClick={() => this.chooseHandler()}
                        />
                    {/*<CarouselCaption captionText={item.caption} captionHeader={item.caption} />*/}
                </CarouselItem>
            );
        });
        return(
            <div>
                <Row className="d-flex justify-content-center">
                    <br/>
                    <h4>
                        Hello dear 
                        {' ' + (getUserInfoField("username") ? getUserInfoField("username") : "guest")}
                        , Welcome to our website!
                    </h4>
                </Row>
                <br/>
                {/*<Row className="d-flex justify-content-around">*/}
                {/*    <Col>*/}
                {/*        <Button  onClick={() => this.redirectHandler("/signup")}>*/}
                {/*            Sign up*/}
                {/*        </Button>*/}
                {/*    </Col>*/}
                {/*    <Col>*/}
                {/*        <Button  onClick={() => this.redirectHandler("/login")}>*/}
                {/*            Login*/}
                {/*        </Button>*/}
                {/*    </Col>*/}
                {/*    <Col>*/}
                {/*        <Button  onClick={() => this.redirectHandler("/search")}>*/}
                {/*            Search*/}
                {/*        </Button>*/}
                {/*    </Col>*/}
                {/*</Row>*/}
                <div>
                    <br/>
                    <Carousel
                        activeIndex={activeIndex}
                        next={this.next}
                        previous={this.previous}
                        className={styles.carouselInner}
                    >
                        <CarouselIndicators items={items} activeIndex={activeIndex} onClickHandler={this.goToIndex} />
                        {slides}
                        <CarouselControl role="button" colour ="muted" direction="prev" directionText="Previous" onClickHandler={this.previous} className={`${styles.carouselArrow} ${styles.carouselArrowLeft}`}/>
                        <CarouselControl  role="button" direction="next" directionText="Next" onClickHandler={this.next} className={`${styles.carouselArrow} ${styles.carouselArrowRight}`}/>
                    </Carousel>
                </div>
            </div>
        )
    }
}

export default withRouter(Welcome);



